SELECT partsupp.ps_comment, AVG(partsupp.ps_suppkey) AS avg_partsupp_ps_suppkey, COUNT(partsupp.ps_availqty) AS count_partsupp_ps_availqty, SUM(partsupp.ps_supplycost) AS sum_partsupp_ps_supplycost, MIN(partsupp.ps_supplycost) AS min_partsupp_ps_supplycost, STDDEV(partsupp.ps_suppkey) AS stddev_partsupp_ps_suppkey FROM partsupp WHERE partsupp.ps_availqty > 349 AND partsupp.ps_availqty BETWEEN 693 AND 927 GROUP BY partsupp.ps_comment ORDER BY partsupp.ps_comment